import { useLocation, useParams } from "react-router";

export default function ChickProduction(props) {
    const { chick } = useParams(); // hook to get the name of the chick in the url... e.g /chicks/:chick/production
    const { state } = useLocation(); // hook to enable us get the pathname, and state sent from clicking the link

    return (
        <div>
            Chick production data...
            <div>{chick}</div>
            <pre>
                {JSON.stringify(state)}
            </pre>
        </div>
    )
}
